// src/App.js
import React from 'react';
import './App.css';
import SearchBar from './SearchBar';
import logo from './assets/jek_logo.png'; // Importe o logo

const App = () => {
    return (
        <div style={{ position: 'relative' }}>
            <img 
                src={logo} 
                alt="Logo da biblioteca" 
                style={{
                    position: 'absolute',
                    top: '10px',
                    left: '10px', // Posiciona o logo no canto superior esquerdo
                    width: '250px', // Tamanho do logo
                    height: 'auto'
                }}
            />
            <div style={{ 
                display: 'flex', 
                alignItems: 'center', 
                justifyContent: 'flex-start', 
                paddingLeft: '280px', // Adiciona padding para não sobrepor o logo
                paddingTop: '10px',
            }}>
                <h1 style={{ color: '#cedae1', marginRight: '20px' }}>jeKlibrary</h1>
                <SearchBar />
            </div>
        </div>
    );
};

export default App;
